import React from 'react';
import {
  Grid, Checkbox, Typography, FormGroup, FormControlLabel,
} from '@material-ui/core';

export default function Checkboxes(): JSX.Element {
  const [state, setState] = React.useState({
    checkedA: true,
    checkedB: true,
    checkedF: true,
    checkedG: true,
  });

  const handleChange = (event: any) => {
    setState({ ...state, [event.target.name]: event.target.checked });
  };

  return (
    <Grid container style={{ justifyContent: 'center' }}>
      <Grid item>
        <Typography style={{ fontSize: 15, paddingLeft: 2 }}>
          책 내부
        </Typography>
      </Grid>
      <Grid item>
        <FormGroup row>
          <FormControlLabel
            control={(
              <Checkbox
                checked={state.checkedB}
                onChange={handleChange}
                name="checkedB"
                color="primary"
              />
        )}
            label="없음"
          />
          <FormControlLabel
            control={(
              <Checkbox
                checked={state.checkedB}
                onChange={handleChange}
                name="checkedB"
                color="primary"
              />
        )}
            label="없음"
          />
          <FormControlLabel
            control={(
              <Checkbox
                checked={state.checkedB}
                onChange={handleChange}
                name="checkedB"
                color="primary"
              />
      )}
            label="없음"
          />
        </FormGroup>
      </Grid>
    </Grid>
  );
}
